import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    Botao: {
      marginTop: 50,
      alignItems: 'center',
      justifyContent: 'center',
      backgroundColor: '#17A558',
      width: 250,
      height: 50,
      left: 75,
      borderRadius: 50
    },
    Segundobotao:{
      marginTop: 20,
      alignItems: 'center',
      justifyContent: 'center',
      backgroundColor: '#B1D3C1',
      width: 250,
      height: 50,
      left: 75,
      borderRadius: 50
    },
    botaopular:{
      marginTop: 15,
      alignItems: 'center',
      justifyContent: 'center',
      width: 250,
      height: 50,
      left: 75,
      borderRadius: 50,
    }
  })

  
  export default styles;
